import React from 'react'

const MessageBox = () => {
  return (
    <div className="message-box">
      <div className="message-box__icon"></div>
      <div className="message-box__content">
        .message-box__content__
      </div>
      <div className="message-box__close"></div>
    </div>
  )
}

export default MessageBox
